<!DOCTYPE html>
<html>
<head>
    <title>Vexar AI</title>
    <style>
        body {
            background-color: #000000;
            color: #ffffff;
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 20px;
        }

        h1 {
            text-align: center;
            margin-bottom: 30px;
            color: #3498db;
        }

        #chat-container {
            background-color: #212121;
            border-radius: 10px;
            padding: 10px;
            max-width: 800px;
            margin: 0 auto;
            box-shadow: 0 0 10px rgba(255, 255, 255, 0.3);
        }

        #chat-log {
            height: 300px;
            overflow-y: auto;
            margin-bottom: 20px;
        }

        p {
            margin: 5px 0;
        }

        input[type="text"] {
            width: 97.4%;
            padding: 10px;
            border: none;
            border-radius: 115px;
            background-color: #1a1a1a;
            color: #ffffff;
        }

.response {
    background-color: #1a1a1a;
    padding: 15px;
    border-radius: 50px;
    display: flex;
    align-items: center;
    margin-bottom: 10px;
    overflow: hidden;
    white-space: nowrap;
    animation: typing 2s steps(40, end);
    background-image: linear-gradient(to right, #000000, #212121);
}

        @keyframes typing {
            from {
                width: 0;
            }
            to {
                width: 100%;
            }
        }

        .input {
    background-image: linear-gradient(to right, #000000, #212121);
            padding: 15px;
            border-radius: 50px;
            display: flex;
            align-items: center;
            margin-bottom: 10px;
        }

        .me-icon,
        .ai-icon {
            background-color: #3498db;
            color: #ffffff;
            display: inline-block;
            width: 30px;
            height: 30px;
            line-height: 30px;
            text-align: center;
            border-radius: 20%;
            margin-right: 10px;
        }

        .me-icon {
            background-color: #ff6b6b;
        }

        .ai-icon {
            background-color: #37c978;
        }
    </style>
</head>
